import { useState } from "react";

import ListGroup from "react-bootstrap/ListGroup";
import Button from "react-bootstrap/Button";

const MisList = ({ mis, solInsts }) => {
  const [show, setshow] = useState(false);
  const disableMis = () => {
    setshow(!show);
  };

  return (
    <>
      <ListGroup as="ul">
        {mis.length === 0
          ? "No"
          : mis.map((mis) => (
              <>
                <ListGroup.Item as="li" key={mis.id} disabled={show}>
                  Name: {mis.name} <br />
                  Solidarity Institution:{" "}
                  {solInsts.map((inst) =>
                    inst.id === mis.solInstId ? inst.name : ""
                  )}
                </ListGroup.Item>
                <Button variant="primary" onClick={() => disableMis()}>
                  show ? Enable : Disable
                </Button>
              </>
            ))}
      </ListGroup>
    </>
  );
};

export default MisList;
